INSERT INTO jobs VALUES
('6d82ffb7-f944-43e2-beb7-82975c5e1b40', 'Sous Chef', 'Assist head chef in kitchen management, prepare authentic kosher meals using traditional recipes and modern techniques. Join our award-winning culinary team serving the community.', 'Jerusalem Grill', NULL, '1154d40b-605a-412a-b311-b5a355b47bcc', 'on-site', false, 'Brooklyn', 'NY', '10002', NULL, NULL, NULL, 'hourly', '25.00', '35.00', 'USD', NULL, 'full-time', NULL, '[]', '["Culinary degree or 2+ years","Kosher laws knowledge","Fast-paced","Weekends"]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, false, false, false, true, false, false, '"2025-10-13T20:11:05.824Z"', NULL, 0, 0, '"2025-10-13T20:11:05.824Z"', '"2025-10-13T20:11:05.824Z"', NULL, 'salary', NULL, NULL, 'active', '"2025-10-27T20:11:05.824Z"', NULL, NULL, NULL, NULL, 'Prepare menu items, train staff, maintain standards, manage inventory, assist menu development.', '[]', true, false, NULL, NULL, '5444ae8c-b7bc-4dd2-b2fb-da5a42c70299'),
('10e64183-284c-428f-a492-3c23e92ed632', 'Store Associate', 'Provide excellent customer service in our busy kosher market. Help customers find products, maintain store appearance, handle transactions with warmth and efficiency.', 'Kosher Market', NULL, 'd559e489-ab47-466b-96a9-32564890fc52', 'on-site', false, 'Manhattan', 'NY', '10003', NULL, NULL, NULL, 'hourly', '15.00', '20.00', 'USD', NULL, 'part-time', NULL, '[]', '["High school diploma","Customer service","Friendly","Lift 30 lbs"]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, false, false, false, true, false, false, '"2025-10-13T20:11:05.824Z"', NULL, 0, 0, '"2025-10-13T20:11:05.824Z"', '"2025-10-13T20:11:05.824Z"', NULL, 'salary', NULL, NULL, 'active', '"2025-10-27T20:11:05.824Z"', NULL, NULL, NULL, NULL, 'Assist customers, stock shelves, operate register, maintain cleanliness, receive deliveries.', '[]', true, false, NULL, NULL, '37f8d29a-fc10-44fe-97c4-3087b2d0aa9c'),
('1078e62c-64fc-4192-8b77-f40e99feb235', 'Restaurant Manager', 'Manage daily operations of our kosher restaurant. Oversee staff, ensure quality service, handle customer relations, and maintain high kosher standards in our community-focused establishment.', 'Kosher Bistro NYC', NULL, '98797739-966d-4d91-847a-a602d6000ec8', 'on-site', false, 'New York', 'NY', '10001', NULL, NULL, NULL, 'salary', '50000.00', '70000.00', 'USD', NULL, 'full-time', NULL, '[]', '["3+ years management","Kosher knowledge","Leadership","Food safety cert"]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, false, false, false, true, false, false, '"2025-10-13T20:11:05.824Z"', NULL, 1, 0, '"2025-10-13T20:11:05.824Z"', '"2025-10-22T21:53:35.460Z"', NULL, 'salary', NULL, NULL, 'active', '"2025-10-27T20:11:05.824Z"', NULL, NULL, NULL, NULL, 'Supervise staff, manage inventory, ensure quality, handle complaints, maintain kosher compliance.', '[]', true, false, NULL, NULL, 'b2c2cd90-7d22-40bf-9ada-3becf7b42bd4');
